  a {
    text-decoration: none;
    color: #305077;
    transition: .2s ease;
  }

  a:hover {
    text-decoration: none;
    color: #a1dbaa;
  }

  h2 {
    font-size: 20px;
    margin-bottom: 10px;
    font-weight: 700;
  }

  .contact {
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    background-color: #f8e682;
    padding: 0 5px;
    width: 100vw;
    position: fixed;
    bottom: 0;
    text-align: center;

    @media (max-width: 400px) {
      position: relative;
    }
  }

  .chunk {
